INSERT INTO `weaving_author` (`author_id`, `email`, `first_name`, `middle_name`, `last_name`, `birthday`, `birth_place_id`, `biography`) VALUES
(1, 'thierry.marianne@aporos.org', 'Thierry', '', 'Marianne', '1984-11-28', 1, 'Thierry Marianne, originaire de St-Pierre de La Réunion, rejoint le projet photographique Sot la mer en 2006. En 2007, c''est à Stuttgart qu''il réalise ses premières images. Son premier diaporama est projeté au cours de l''événement St-Denis Photo en mars 2008. Aujourd''hui Il vit à Budapest où il y travaille pour une association sans but lucratif et c''est en tant que photographe du collectif Aporos qu''il éprouve toujours autant sa passion de l''écriture par la lumière.'),
(2, 'funkybastard77@gmail.com', 'SoleÃ¯man', '', 'Badat', '0000-00-00', -1, ''),
(3, 'nelson.navin@gmail.com', 'Nelson', '', 'Navin', '1971-11-24', 2, 'Co-fondateur du collectif APOROS, Nelson Navin s’initie à la photographie en 2002. Au cœur de son travail, l’humain occupe une place privilégiée. Après avoir participé aux VIèmes Rencontres africaines de la photographie à Bamako (2005) et aux Voies Off des Rencontres d’Arles (2006) il reçoit le prix national Culture-ActionS (CNOUS) en 2006 pour le deuxième volet du projet Sot la mer.'),
(4, 'toniox@orange.fr', 'Antonio', '', 'Prianon', '1975-07-05', 4, 'Né en 1975 à La Réunion, Antonio Prianon exerce le métier de photographe pour la presse locale. En 2006 il découvre le sténopé, un appareil photographique, muni d’un simple trou microscopique en lieu et place de l’objectif. Ces appareils qu’il fabrique lui-même permettent de capturer l’image avec des temps d’expositions relativement long. Antonio intervient notamment dans des ateliers d’Aporos au seins des quartiers défavorisés.');
