(3, NULL, 2, 15, 1, 1, 'edit.basic.information', 'Edit basic information', 'disclaimers:\r\n  -\r\n    requirements\r\nfields:\r\n  -\r\n    accesskey: u\r\n    before.update:\r\n      display: disclaimer.safe_changes\r\n      save.to: db.contact\r\n      send: email.changes_confirmation\r\n    confirmation: email\r\n    display.default.value: db.user.user_name*\r\n    name: user_name\r\n    type: text*\r\n    tabindex: 1\r\n  -\r\n    accesskey: e\r\n    before.update:\r\n      display: disclaimer.safe_changes\r\n      save.to: db.contact\r\n      send: email.changes_confirmation\r\n    display.default.value: db.user.email*\r\n    name: email\r\n    type: email*\r\n    tabindex: 2\r\n  -\r\n    accesskey: f\r\n    display.default.value: db.user.first_name*\r\n    name: first_name\r\n    type: text*\r\n    tabindex: 3\r\n  -\r\n    accesskey: m\r\n    display.default.value: db.user.middle_name*\r\n    name: middle_name\r\n    tabindex: 4\r\n    type: text\r\n  -\r\n    accesskey: l  \r\n    display.default.value: db.user.last_name*\r\n    name: last_name\r\n    tabindex: 5\r\n    type: text*\r\n  -\r\n    accesskey: s  \r\n    name: submit\r\n    tabindex: 6\r\n    type: submit\r\n    value: update\r\n    disclaimers:\r\nlayout:\r\n  title_level_2: contact_information'),
