(11, NULL, 2, 15, 1, 1, 'send.document', 'Send document', 'disclaimers:\r\n  -\r\n    requirements\r\nfields:\r\n  - \r\n    name: file\r\n    accesskey: f\r\n    move.to: fs.snapshots\r\n    type: file\r\n  -\r\n    name: title\r\n    accesskey: t\r\n    save.to: db.photo.title*\r\n    type: text\r\n  -\r\n    name: keywords\r\n    accesskey: k\r\n    after.update:\r\n      display: disclaimer.upload_successful    \r\n    save.to: db.photo.keywords*\r\n    type: text\r\n  -\r\n    name: submit\r\n    class: upload\r\n    accesskey: s\r\n    id: submit_document\r\n    type: submit\r\n    value: upload\r\nlayout:\r\n  title_level_2: upload_photograph');
