":"Paul Garafola","id":"682076460"},"message":"Cause and Effect.","created_time":"2012-04-25T03:46:11+0000","likes":1}],"count":1}},{"id":"1232505473_423316584363044","from":{"name":"Michelle Hale","id":"1232505473"},"message":"My kids were raised with a Black Shepherd named Loretta.  She was my eyes, my ears, and the protector.  She would and have died for her kids.  What a wonderful friend and family member she was..  So when I saw this I had to share.  I love a German Shepherds.  You don''t get any better. \\n","picture":"https:\\/\\/fbcdn-photos-a.akamaihd.net\\/hphotos-ak-ash3\\/523149_292615027482257_131817526895342_658244_1019210790_s.jpg","link":"http:\\/\\/www.facebook.com\\/photo.php?fbid=292615027482257&set=a.213076235436137.49953.131817526895342&type=1","name":"A Family is a Little World Created by Love","caption":"WORLD''S OLDEST SECURITY SYSTEM: Unconditional love provided as an added bonus.  \\nSatisfaction, guaranteed. \\n\\nQuite possibly this is my favorite poster in the \\"Family\\" album by far...consider this the \\"before\\"...an \\"after\\" poster for the Family album is to follow! ;)  The photographer of this photograph, Jen Hendricks provided the following backstory: \\n\\"Some people have commented on how I put my little girl in such a ''dangerous'' position, but I was taking the picture so I was right there.  I assure you, had my GSD Maverick moved an inch, my camera would''ve made the ultimate sacrifice lol. :) My daughter Gracie was 8 weeks early, 3 lbs 8.5oz, 16 inches long and I took this picture around her original due date, which was August 14th, 2008. Maverick was about a year and a half and weighed in around 65 lbs at that point. Today, Gracie is a healthy, active, intelligent little 3 year old and at age 5, Maverick is still as spunky as she was when she was at 8 weeks old when I brought her home.\\"\\n\\nThe \\"after\\" family album poster is coming soon...Grace and Maverick today...STILL best friends. <3 A huge thanks to Jen for taking this photograph and allowing the world to share in such an absolutely priceless moment which is a testament to the GSD breed we know and love! :) ~Cheryl","description":"A positive album with our GSDs to show the enduring bond of \\"families.\\" <3  Feel free to click \\"share\\" on any of these photo creations!\\n","properties":[{"name":"By","text":"The German Shepherd Dog Community","href":"http:\\/\\/www.facebook.com\\/TheGSDC"}],"icon":"https:\\/\\/s-static.ak.facebook.com\\/rsrc.php\\/v1\\/yD\\/r\\/aS8ecmYRys0.gif","actions":[{"name":"Comment","link":"http:\\/\\/www.facebook.com\\/1232505473\\/posts\\/423316584363044"},{"name":"Like","link":"http:\\/\\/www.facebook.com\\/1232505473\\/posts\\/423316584363044"}],"type":"photo","object_id":"292615027482257","application":{"name":"Links","id":"2309869772"},"created_time":"2012-04-25T03:28:32+0000","updated_time":"2012-04-25T14:12:46+0000","likes":{"data":[{"name":"Michelle Hale","id":"1232505473"},{"name":"Marcie Neville","id":"1737374413"}],"count":9},"comments":{"data":[{"id":"1232505473_423316584363044_5287125","from":{"name":"Michelle Hale","id":"1232505473"},"message":"I would say a new born.  My Shepherd was very large, she was 110 pounds and I could walk with my hand on her neck as an adult.  She was always on patrol, keeping us safe and protected.  She just had a beautiful heart.","created_time":"2012-04-25T12:06:03+0000"},{"id":"1232505473_423316584363044_5287696","from":{"name":"Christopher Jacka","id":"1266146485"},"message":"Ha! When I was a kid my mothers huge cat was always on patrol, walking figure eight patterns through the house at night. He faught off a few dogs and racoons. He was tough. ","created_time":"2012-04-25T14:12:46+0000","likes":1}],"count":5}},{"id":"1417669498_3019056161571","from":{"name":"Loic Le Meur","id":"1417669498"},"message":"Sequoia National Park - The Most Influential Places in History - TIME","link":"http:\\/\\/see.sc\\/HIinto","name":"The Most Influential Places in