INSERT INTO `weaving_query` (`qry_id`, `qry_status`, `qry_type`, `qry_value`, `qry_date_creation`, `qry_date_update`) VALUES
(4, 1, 1, 'SELECT\r\n       usr_id AS user_id,\r\n#     grp_id AS group_id,\r\n     usr_status AS user_status,\r\n      usr_user_name AS user_name,\r\n#        usr_avatar AS avatar,\r\n       usr_first_name AS first_name,\r\n       usr_last_name AS last_name,\r\n#        usr_middle_name AS middle_name,\r\n     usr_email AS email\r\nFROM\r\n  weaving_user\r\nWHERE\r\n   usr_id != 6', '2010-10-23 11:00:33', '0000-00-00 00:00:00'),
(32, 1, 1, 'SELECT\r\n  etp_id entity_type_id,\r\n  ety_name entity_name,\r\n   IF (etp_default, ''TRUE'', ''FALSE'') default_type,\r\n etp_index entity_type_index,\r\n    etp_name entity_type_name,\r\n  etp_value entity_type_value\r\nFROM\r\n weaving_entity ety,\r\n weaving_entity_type etp \r\nWHERE\r\n   ety.ety_id = etp.ety_id\r\nGROUP BY\r\n ety.ety_id,\r\n etp.etp_index\r\nORDER BY\r\n   ety.ety_id,\r\n etp.etp_index', '2010-11-08 23:43:07', '0000-00-00 00:00:00'),
(47, 1, 1, 'SELECT \r\n log_occurrence occurences,\r\n# log_message pre__message,\r\n#  log_context pre__context,\r\n   log_exception unserialize_object_message_pre__exception,\r\n    log_creation_date creation_date,\r\n    log_update_date update_date\r\nFROM\r\n weaving_log\r\nWHERE \r\n   log_type = 3 AND\r\n    TO_DAYS( NOW() ) -\r\n      TO_DAYS(    \r\n            IF (\r\n                log_update_date != ''0000-00-00 00:00:00'',\r\n             log_update_date,\r\n                log_creation_date\r\n           ) \r\n      ) < 7\r\nORDER BY\r\n   IF (\r\n        log_update_date != ''0000-00-00 00:00:00'',\r\n     log_update_date,\r\n        log_creation_date\r\n   ) DESC', '2010-11-13 15:39:31', '0000-00-00 00:00:00');
