(1, 1, '3ea9620893c3088913a3b3bf59d62823', 1, 3, 15, 'safe_changes', 'For security reasons, the latest changes you have made will take place only after you have confirmed them. Please check your emails. ', '2010-06-05 14:12:39'),
(2, 1, '47e0ca0fea7eb9e3407d9de38d2cb9b7', 1, 4, 15, 'changes_confirmation', 'Dear {$name},\r\n\r\nSomeone asked us to update the following item(s) in your profile page:\r\n{foreach from=$updates key=index item=update}\r\n- {$update}\r\n{/foreach}\r\n\r\nPlease confirm the changes listed above by clicking on the following confirmation link within the next 24 hours:\r\n{$link} \r\n\r\nIf you have never planned to make these changes or you are willing to discard the modifications, please simply ignore this message. \r\n\r\nKind regards,\r\n{$signature}', '2010-06-05 14:18:03'),
(3, 1, '156c4826189b1f2dba51846fdc35e579', 1, 3, 15, 'password_has_changed', 'Your password has been successfully updated.', '2010-06-05 14:12:39'),
(4, 1, '47e0ca0fea7eb9e3407d9de38d2cb9b7', 1, 4, 24, 'retrieve_password', 'Dear {$name},\r\n\r\nSomeone asked us to renew your password:\r\n{$password}\r\n\r\nTo confirm your new password, just click on the following link within the next 24 hours (After signing in again, you will be able to change it again from your profile page):\r\n{$link} \r\n\r\nIf you have never planned to make these changes or you are willing to discard the modifications, please simply ignore this message. \r\n\r\nKind regards,\r\n{$signature}', '2010-06-05 14:18:03'),
(5, 1, '2812abdc5cab684727f293773bae5a91', 1, 3, 15, 'upload_successful', 'Your photograph was uploaded successfully.', '2010-06-05 14:12:39');
